import { useState } from "react";

const Todo = () => {
  const todosList = [
    {
      id: 1,
      content: "店予約する",
    },
    {
      id: 2,
      content: "卵買う",
    },
    {
      id: 3,
      content: "郵便出す",
    },
  ];

  return (
    <>
      {todosList.map((task) => (
        <div>
          <button key={task.content}>完了</button>
          <div key={task.id}>{task.content}</div>
        </div>
      ))}
    </>
  );
};

export default Todo;
